import Card from "components/Card/Card.js";
import CardHeader from "components/Card/CardHeader.js";



function Allissue() {
  
    return (
     

       
       
          <Card >
            <CardHeader>
              <center>
                <h4>
                  <b>All Issue</b>
                </h4>
              </center>
              <br />
            </CardHeader>
           
          </Card>
       
     



       
    )
}

export default Allissue
